    const [jogadores, setJogadores] = useState([]);

    async function GetJogadores(uri) {
        try {
            const res = await api.get(uri);
            // setJogadores(res);
            return res;
        } catch (err) {
            console.log(err)
        }
    }


    return (
        <>
            <MenuStyle>

                <div className="container">
                    <SideBar />  
                </div>

            </MenuStyle>
        </>
    );
}

export default Menu;
